(1,'en_US','Bmw 530','Pārdod labu, ērtu un jaudīgu auto - GT 530d rets facelift modelis.\n\nĻoti laba komplektācija\n-piesūcošās durvis (nav jācērt, aizveras pašas)\n-lielā panorāmas lūka\n-melnie griesti\n-ādas salons\n-kājas sensors lai atvērtu bagāžnieka vāks\n-automātiski atlokās piekabes āķis\n-pilnpiedziņa\n-lampas seko līdzi ceļa līkumiem\n-pneimo piekare\n\nJaunas ziemas riepas ar radzēm. Jauns akumulators, tikko mainītas eļļas.\n\nĻoti labs auto, brauc ļoti patīkami, mīksti un ērti. Daudz vietas gan salonā gan bagāžas nodalījumā, izcils ģimenes auto.\n\nPatiess un pārbaudāms nobraukums.\n\nPārdod īpašnieks, atrodas Jūrmalā.');
