('osclass','widget_data_blog','{\"date\":\"2025-03-01 01:22:29\",\"data\":[{\"id\":\"43\",\"slug\":\"seo-classifieds-marketplace-plugin-pro\",\"image\":\"https:\\/\\/osclasspoint.com\\/oc-content\\/plugins\\/blog\\/img\\/blog\\/43.png\",\"category_id\":\"3\",\"views\":\"4407\",\"pub_date\":\"2023-07-18 00:00:00\",\"title\":\"Seo PRO Classifieds Plugin\",\"subtitle\":\"Professional solution to fine-tune meta tags on Osclass classifieds website\",\"description\":\"Seo PRO Plugin helps to manage meta title, description and \\\"Seo text\\\" on your website with ease, create unique tags those attract customers and customize tags for specific combination of parameters (ie. one city on search). This article is focused to explain how to work with plugin and understand it\'s features. It will be updated based on questions from customers. \\u00a0 Search page tags - what they means and how they works There are many tabs on Search page those specify current location of user. Pl...\",\"short_description\":\"Professional solution to fine-tune meta tags on Osclass classifieds website\",\"link\":\"https:\\/\\/osclasspoint.com\\/blog\\/seo-classifieds-marketplace-plugin-pro-b43\"},{\"id\":\"42\",\"slug\":\"osclass-810-major-release-2023\",\"image\":\"https:\\/\\/osclasspoint.com\\/oc-content\\/plugins\\/blog\\/img\\/blog\\/42.jpg\",\"category_id\":\"1\",\"views\":\"21596\",\"pub_date\":\"2023-01-13 00:00:00\",\"title\":\"Osclass 8.1.0 Major Release - 2023 Classifieds Update\",\"subtitle\":\"We\'ve been hardly working almost year to bring Osclass into next level. Listened community, read forums, checked emails and always there was great idea, implemented this into Osclass. Our goal was to make Osclass classifieds script easier to use, easier to configure, turn partial solution into full-scope enterprise features.\",\"description\":\"Next level classifieds software Last year was extremely hard, as there has been a lot going on in the world, extreme price rising, problems to find developers, war, ... Even it was complicated, our team is bringing you super huge update that not only fix minor issues, but integrates most wanted features ever requested by community, improvements in cache, documentation updates, removal of useless features and more and more and more... We will only review most important features, full list is in c...\",\"short_description\":\"We\'ve been hardly working almost year to bring Osclass into next level. Listened community, read forums, checked emails and always there was great idea, implemented this into Osclass. Our goal was to make Osclass classifieds script easier to use, easier to configure, turn partial solution into full-scope enterprise features.\",\"link\":\"https:\\/\\/osclasspoint.com\\/blog\\/osclass-810-major-release-2023-b42\"},{\"id\":\"41\",\"slug\":\"osclass-802-update\",\"image\":\"https:\\/\\/osclasspoint.com\\/oc-content\\/plugins\\/blog\\/img\\/blog\\/41.jpg\",\"category_id\":\"1\",\"views\":\"21056\",\"pub_date\":\"2022-05-05 00:00:00\",\"title\":\"Osclass 8.0.2 major release\",\"subtitle\":\"Latest update brings speed enhancements, security updates as well as new features. \",\"description\":\"Osclass 8.0.2 review May osclass update comes after several months of work and follow continuous improvements from 8.0.1. Today we will do just quick summary to avoid long stories :-) Download Osclass 8.0.2 Upsert function support New function has been added into core that greatly helps developers to update or insert data into database without need to explicitly check if record already exists in table Image canvas background It is possible now to change canvas background for media and can be swi...\",\"short_description\":\"Latest update brings speed enhancements, security updates as well as new features. \",\"link\":\"https:\\/\\/osclasspoint.com\\/blog\\/osclass-802-update-b41\"},{\"id\":\"40\",\"slug\":\"pwa-osclass-classifieds\",\"image\":\"https:\\/\\/osclasspoint.com\\/oc-content\\/plugins\\/blog\\/img\\/blog\\/40.jpg\",\"category_id\":\"1\",\"views\":\"18304\",\"pub_date\":\"2022-03-08 00:00:00\",\"title\":\"Why you need PWA?\",\"subtitle\":\"Progressive Web Apps technologies can change the way how you look on website, your view on native applications and improve user experience.\",\"description\":\"What is Progressive Web App You might be wondering what is so cool about PWA and what it actually is. We can say that PWA is set of different technologies those when combined together, empower your website and improve user experience. I strongly recommend to read some articles about Progressive Web Apps and how big companies use them to engage their customers and bring more revenues. In order to keep this article short and clean, I will be talking just about benefits, not too much about technica...\",\"short_description\":\"Progressive Web Apps technologies can change the way how you look on website, your view on native applications and improve user experience.\",\"link\":\"https:\\/\\/osclasspoint.com\\/blog\\/pwa-osclass-classifieds-b40\"},{\"id\":\"39\",\"slug\":\"osclass-801-release\",\"image\":\"https:\\/\\/osclasspoint.com\\/oc-content\\/plugins\\/blog\\/img\\/blog\\/39.jpg\",\"category_id\":\"1\",\"views\":\"20503\",\"pub_date\":\"2022-01-03 00:00:00\",\"title\":\"Osclass 8.0.1 release\",\"subtitle\":\"First Osclass release in new year is there and brings bunch of cool updates: PHP 8.1 preparation, Mobile ready installation, RTL support of languages, Ban rules improvements and much more!\",\"description\":\"Osclass 8.0.1 release review We\'ve been working for several weeks on new update and it\'s time to release it and share with community. \\u00a0 PHP 8.1 initial work First steps to make Osclass compatible with 8.1 has started, currently we are being blocked by external libraries Osclass use those are yet not ready for PHP 8.1 and generate notices\\/errors. \\u00a0 Mobile ready installation Installation process has been redesigned in order to make it fully responsive, so there is no issue to install Osclass from ...\",\"short_description\":\"First Osclass release in new year is there and brings bunch of cool updates: PHP 8.1 preparation, Mobile ready installation, RTL support of languages, Ban rules improvements and much more!\",\"link\":\"https:\\/\\/osclasspoint.com\\/blog\\/osclass-801-release-b39\"}]}','STRING'),
